import React from 'react';

const Test = () => {
  // Replace the latitude and longitude values with your desired location
  const latitude = 37.7749;
  const longitude = -122.4194;

  return (
    <div>
      <iframe
        title="Google Map"
        width="600"
        height="450"
        frameborder="0"
        style={{ border: 0 }}
        src={`<iframe src="https://www.google.com/maps/embed?pb=!1m14!1m12!1m3!1d126844.06348606381!2d3.3652736!3d6.537216!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sen!2sng!4v1706517127493!5m2!1sen!2sng" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>=${latitude},${longitude}&key=YOUR_GOOGLE_MAPS_API_KEY`}
        allowfullscreen
      ></iframe>
    </div>
  );
};

export default Test;
